import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Text, View, ScrollView,Image } from 'react-native';
import {styles} from './styles/style'

export default function App() {
  return (
    <View>
      <View style={styles.header}>
        <View style={{ flex: 12, justifyContent: 'center', alignItems:'center'}}>
          {/* <Text style={{color: 'white', fontSize: 25 }}>Öz civata</Text> */}
          <Image style={{ resizeMode: 'stretch', height: 50, width: '80%', borderRadius:10}} source={require('./assets/ozcivata.jpeg')}></Image>
        </View>

      </View>
      <ScrollView>

        <View style={styles.container}>
          <Text>Tutku Sarıdağ</Text>
          <Text>Oz civata</Text>
          <StatusBar style="auto" />
        </View>
      </ScrollView>
    </View>
  );
}
